script:
frankieRuntime = {
	Survey : {
		relevance_map: function(state) {return {G1: state.G1.relevance,Q1: state.Q1.relevance,Q2: state.Q2.relevance,Q3: state.Q3.relevance,Q4: state.Q4.relevance,G2: state.G2.relevance,Q5: state.Q5.relevance,Q6: state.Q6.relevance,Q7: state.Q7.relevance,G3: state.G3.relevance,Q8: state.Q8.relevance,Q9: state.Q9.relevance,Q10: state.Q10.relevance,Q11: state.Q11.relevance,G4: state.G4.relevance,Q12: state.Q12.relevance};},
		has_previous: function(state) {return (function(){if(!state.Survey.before_navigation||!state.Survey.relevance_map){return false;}for(var i=0;i<state.Survey.before_navigation.length;i++){if(state.Survey.relevance_map[state.Survey.before_navigation[i]]){return true}}return false;})();},
		has_next: function(state) {return (function(){if(!state.Survey.after_navigation||!state.Survey.relevance_map){return false;}for(var i=0;i<state.Survey.after_navigation.length;i++){if(state.Survey.relevance_map[state.Survey.after_navigation[i]]){return true}}return false;})();},
		validity: function(state) {return (!state.G1.in_current_navigation || state.G1.validity) && (!state.G2.in_current_navigation || state.G2.validity) && (!state.G3.in_current_navigation || state.G3.validity) && (!state.G4.in_current_navigation || state.G4.validity);}
	},
	G1 : {
		relevance: function(state) {return state.G1.prioritised;},
		validity: function(state) {return !state.G1.relevance || ((!state.Q1.in_current_navigation || state.Q1.validity) && (!state.Q2.in_current_navigation || state.Q2.validity) && (!state.Q3.in_current_navigation || state.Q3.validity) && (!state.Q4.in_current_navigation || state.Q4.validity));},
		prioritised: function(state) {return [state.G2.relevance, state.G3.relevance].filter(Boolean).length < 4 - state.G1.priority;}
	},
	Q1 : {
		validation_required: function(state) {return FrankieScripts.isVoid(state.Q1.value);},
		validation_min_char_length: function(state) {return FrankieScripts.isNotVoid(state.Q1.value) && state.Q1.value.length < 2;},
		validation_max_char_length: function(state) {return FrankieScripts.isNotVoid(state.Q1.value) && state.Q1.value.length > 30;},
		relevance: function(state) {return state.G1.relevance;},
		validity: function(state) {return !state.Q1.relevance || ((!state.Q1.validation_required && !state.Q1.validation_min_char_length && !state.Q1.validation_max_char_length && !state.Q1.validation_pattern));},
		validation_pattern: function(state) {return FrankieScripts.isNotVoid(state.Q1.value) && !RegExp("^[A-Za-z][-\.A-Za-z ]+$").test(state.Q1.value);}
	},
	Q2 : {
		validation_required: function(state) {return FrankieScripts.isVoid(state.Q2.value);},
		validation_between: function(state) {return FrankieScripts.isNotVoid(state.Q2.value) && (state.Q2.value < 25 || state.Q2.value > 180);},
		relevance: function(state) {return state.G1.relevance;},
		validity: function(state) {return !state.Q2.relevance || ((!state.Q2.validation_required && !state.Q2.validation_between));}
	},
	Q3 : {
		validation_required: function(state) {return FrankieScripts.isVoid(state.Q3.value);},
		relevance: function(state) {return state.G1.relevance;},
		validity: function(state) {return !state.Q3.relevance || ((!state.Q3.validation_required && !state.Q3.validation_max_char_length && !state.Q3.validation_pattern_email));},
		validation_max_char_length: function(state) {return FrankieScripts.isNotVoid(state.Q3.value) && state.Q3.value.length > 25;},
		validation_pattern_email: function(state) {return FrankieScripts.isNotVoid(state.Q3.value) &&  !/^\w+@[a-zA-Z_]+?\.[a-zA-Z]{2,3}$/.test(state.Q3.value);}
	},
	Q4 : {
		validation_required: function(state) {return FrankieScripts.isVoid(state.Q4.value);},
		validation_max_word_count: function(state) {return FrankieScripts.isNotVoid(state.Q4.value) &&  FrankieScripts.wordCount(state.Q4.value) > 500;},
		validation_min_word_count: function(state) {return FrankieScripts.isNotVoid(state.Q4.value) &&  FrankieScripts.wordCount(state.Q4.value) < 10;},
		relevance: function(state) {return state.G1.relevance;},
		validity: function(state) {return !state.Q4.relevance || ((!state.Q4.validation_required && !state.Q4.validation_max_word_count && !state.Q4.validation_min_word_count));}
	},
	G2 : {
		relevance: function(state) {return state.G2.prioritised;},
		validity: function(state) {return !state.G2.relevance || ((!state.Q5.in_current_navigation || state.Q5.validity) && (!state.Q6.in_current_navigation || state.Q6.validity) && (!state.Q7.in_current_navigation || state.Q7.validity));},
		prioritised: function(state) {return [state.G1.relevance, state.G3.relevance].filter(Boolean).length < 4 - state.G2.priority;}
	},
	Q5 : {
		masked_value: function(state) {return state.Q5.value ? {A1: state.Q5A1.label,A2: state.Q5A2.label,A3: state.Q5A3.label,Aother: state.Q5AotherAtext.value}[state.Q5.value] : '';},
		validation_required: function(state) {return FrankieScripts.isVoid(state.Q5.value);},
		relevance: function(state) {return state.G2.relevance;},
		validity: function(state) {return !state.Q5.relevance || (!state.Q5.validation_required && state.Q5Aother.validity);}
	},
	Q5A1 : {
		relevance: function(state) {return state.Q5.relevance;}
	},
	Q5A2 : {
		relevance: function(state) {return state.Q5.relevance;}
	},
	Q5A3 : {
		relevance: function(state) {return state.Q5.relevance;}
	},
	Q5Aother : {
		relevance: function(state) {return state.Q5.relevance;},
		validity: function(state) {return !state.Q5Aother.relevance || state.Q5AotherAtext.validity;}
	},
	Q5AotherAtext : {
		validation_required: function(state) {return FrankieScripts.isVoid(state.Q5AotherAtext.value);},
		conditional_relevance: function(state) {return state.Q5.value === 'Aother';},
		relevance: function(state) {return state.Q5Aother.relevance && state.Q5AotherAtext.conditional_relevance;},
		validity: function(state) {return !state.Q5AotherAtext.relevance || !state.Q5AotherAtext.validation_required;}
	},
	Q6 : {
		validation_max_option_count: function(state) {return [state.Q6A1.value,state.Q6A2.value,state.Q6A3.value,state.Q6Aother.value].filter(Boolean).length > 3;},
		masked_value: function(state) {return FrankieScripts.listStrings([{ value:state.Q6A1.value, label:state.Q6A1.label }, { value:state.Q6A2.value, label:state.Q6A2.label }, { value:state.Q6A3.value, label:state.Q6A3.label }, { value:state.Q6Aother.value, label:state.Q6AotherAtext.value }].filter(function(elem){return elem.value}).map(function(elem){return elem.label}), state.Survey.lang);},
		relevance: function(state) {return state.G2.relevance;},
		validity: function(state) {return !state.Q6.relevance || ((!state.Q6.validation_max_option_count && !state.Q6.validation_min_option_count) && state.Q6Aother.validity);},
		validation_min_option_count: function(state) {return [state.Q6A1.value,state.Q6A2.value,state.Q6A3.value,state.Q6Aother.value].filter(Boolean).length < 1;}
	},
	Q6A1 : {
		relevance: function(state) {return state.Q6.relevance;}
	},
	Q6A2 : {
		relevance: function(state) {return state.Q6.relevance;}
	},
	Q6A3 : {
		relevance: function(state) {return state.Q6.relevance;}
	},
	Q6Aother : {
		relevance: function(state) {return state.Q6.relevance;},
		validity: function(state) {return !state.Q6Aother.relevance || state.Q6AotherAtext.validity;}
	},
	Q6AotherAtext : {
		validation_required: function(state) {return FrankieScripts.isVoid(state.Q6AotherAtext.value);},
		conditional_relevance: function(state) {return state.Q6Aother.value === true;},
		relevance: function(state) {return state.Q6Aother.relevance && state.Q6AotherAtext.conditional_relevance;},
		validity: function(state) {return !state.Q6AotherAtext.relevance || !state.Q6AotherAtext.validation_required;}
	},
	Q7 : {
		relevance: function(state) {return state.G2.relevance;},
		validity: function(state) {return !state.Q7.relevance || (state.Q7A1.validity && state.Q7A2.validity && state.Q7A3.validity);}
	},
	Q7Ac1 : {
		relevance: function(state) {return state.Q7.relevance;}
	},
	Q7Ac2 : {
		relevance: function(state) {return state.Q7.relevance;}
	},
	Q7Ac3 : {
		relevance: function(state) {return state.Q7.relevance;}
	},
	Q7A1 : {
		masked_value: function(state) {return state.Q7A1.value ? {Ac1: state.Q7Ac1.label,Ac2: state.Q7Ac2.label,Ac3: state.Q7Ac3.label}[state.Q7A1.value] : '';},
		validation_required: function(state) {return ['Ac1','Ac2','Ac3'].indexOf(state.Q7A1.value) == -1;},
		relevance: function(state) {return state.Q7.relevance;},
		validity: function(state) {return !state.Q7A1.relevance || !state.Q7A1.validation_required;}
	},
	Q7A2 : {
		masked_value: function(state) {return state.Q7A2.value ? {Ac1: state.Q7Ac1.label,Ac2: state.Q7Ac2.label,Ac3: state.Q7Ac3.label}[state.Q7A2.value] : '';},
		validation_required: function(state) {return ['Ac1','Ac2','Ac3'].indexOf(state.Q7A2.value) == -1;},
		relevance: function(state) {return state.Q7.relevance;},
		validity: function(state) {return !state.Q7A2.relevance || !state.Q7A2.validation_required;}
	},
	Q7A3 : {
		masked_value: function(state) {return state.Q7A3.value ? {Ac1: state.Q7Ac1.label,Ac2: state.Q7Ac2.label,Ac3: state.Q7Ac3.label}[state.Q7A3.value] : '';},
		validation_required: function(state) {return ['Ac1','Ac2','Ac3'].indexOf(state.Q7A3.value) == -1;},
		relevance: function(state) {return state.Q7.relevance;},
		validity: function(state) {return !state.Q7A3.relevance || !state.Q7A3.validation_required;}
	},
	G3 : {
		relevance: function(state) {return state.G3.prioritised;},
		validity: function(state) {return !state.G3.relevance || ((!state.Q8.in_current_navigation || state.Q8.validity) && (!state.Q9.in_current_navigation || state.Q9.validity) && (!state.Q10.in_current_navigation || state.Q10.validity) && (!state.Q11.in_current_navigation || state.Q11.validity));},
		prioritised: function(state) {return [state.G1.relevance, state.G2.relevance].filter(Boolean).length < 4 - state.G3.priority;}
	},
	Q8 : {
		validation_required: function(state) {return FrankieScripts.isVoid(state.Q8.value) || !state.Q8.value.size || !state.Q8.value.stored_filename;},
		relevance: function(state) {return state.G3.relevance;},
		validity: function(state) {return !state.Q8.relevance || !state.Q8.validation_required;}
	},
	Q9 : {
		validation_required: function(state) {return FrankieScripts.isVoid(state.Q9.value);},
		relevance: function(state) {return state.G3.relevance;},
		validity: function(state) {return !state.Q9.relevance || !state.Q9.validation_required;},
		masked_value: function(state) {return FrankieScripts.formatSqlDate(state.Q9.value, "YYYY/MM/DD") + " " + FrankieScripts.formatTime(state.Q9.value, false);}
	},
	Q10 : {
		validation_required: function(state) {return FrankieScripts.isVoid(state.Q10.value);},
		relevance: function(state) {return state.G3.relevance;},
		validity: function(state) {return !state.Q10.relevance || !state.Q10.validation_required;},
		masked_value: function(state) {return FrankieScripts.formatSqlDate(state.Q10.value, "MM.DD.YYYY");}
	},
	Q11 : {
		validation_required: function(state) {return FrankieScripts.isVoid(state.Q11.value);},
		relevance: function(state) {return state.G3.relevance;},
		validity: function(state) {return !state.Q11.relevance || !state.Q11.validation_required;},
		masked_value: function(state) {return FrankieScripts.formatTime(state.Q11.value, true);}
	},

}
